			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# --- SwiftLint incremental: solo ficheros .swift cambiados ---\n# Requiere: git y swiftlint instalados. Shell recomendado: /bin/zsh\n\nset -euo pipefail\nexport PATH=\"/opt/homebrew/bin:/usr/local/bin:$PATH\"\n\nif ! command -v swiftlint >/dev/null 2>&1; then\n  echo \"warning: SwiftLint no está instalado. https://github.com/realm/SwiftLint\"\n  exit 0\nfi\n\n# Raíz del repo (fallback a SRCROOT si no es git)\nGIT_ROOT=\"$(git -C \"$SRCROOT\" rev-parse --show-toplevel 2>/dev/null || echo \"$SRCROOT\")\"\n\n# Rama/base contra la que comparamos (personalizable con LINT_BASE_REF)\nBASE_REF=\"${LINT_BASE_REF:-origin/main}\"\n\n# Calcula el rango para 'cambios en esta rama'\nif git -C \"$GIT_ROOT\" rev-parse --verify \"$BASE_REF\" >/dev/null 2>&1; then\n  MERGE_BASE=\"$(git -C \"$GIT_ROOT\" merge-base HEAD \"$BASE_REF\")\"\n  RANGE=\"$MERGE_BASE...HEAD\"\nelse\n  # Fallback: último commit\n  RANGE=\"HEAD~1...HEAD\"\nfi\n\n# Archivos .swift modificados (A, C, M, R) + no trackeados\nCHANGED_SWIFT=\"$(git -C \"$GIT_ROOT\" diff --name-only --diff-filter=ACMR $RANGE -- '*.swift' || true)\"\nUNTRACKED_SWIFT=\"$(git -C \"$GIT_ROOT\" ls-files --others --exclude-standard -- '*.swift' || true)\"\n\n# Mezcla y normaliza (elimina duplicados)\nALL_SWIFT=\"$(printf \"%s\\n%s\\n\" \"$CHANGED_SWIFT\" \"$UNTRACKED_SWIFT\" | awk 'NF' | sort -u)\"\n\nif [[ -z \"$ALL_SWIFT\" ]]; then\n  echo \"SwiftLint: no hay .swift modificados. Omitiendo lint.\"\n  exit 0\nfi\n\n# Rutas de config y del paquete local\nAPP_CONFIG=\"$SRCROOT/.swiftlint.yml\"\nPKG_DIR=\"${PKG_DIR:-$SRCROOT/SwiftPersistance}\"\nPKG_CONFIG=\"$PKG_DIR/.swiftlint.yml\"\n\n# Particiona: ficheros del paquete vs del resto\nAPP_FILES=()\nPKG_FILES=()\n\nwhile IFS= read -r relpath; do\n  fullpath=\"$GIT_ROOT/$relpath\"\n  # Ignora archivos que ya no existan (renames a otros tipos, etc.)\n  [[ -f \"$fullpath\" ]] || continue\n  case \"$fullpath\" in\n    \"$PKG_DIR\"/*) PKG_FILES+=(\"$fullpath\") ;;\n    *)            APP_FILES+=(\"$fullpath\") ;;\n  esac\ndone <<< \"$ALL_SWIFT\"\n\nlint_with_list () {\n  local cfg=\"$1\"; shift\n  local -a files=(\"$@\")\n  [[ ${#files[@]} -eq 0 ]] && return 0\n\n  # Pasa la lista a SwiftLint usando --use-script-input-files\n  export SCRIPT_INPUT_FILE_COUNT=${#files[@]}\n  local i=0\n  for f in \"${files[@]}\"; do\n    eval \"export SCRIPT_INPUT_FILE_$i=\\\"${f}\\\"\"\n    ((i++))\n  done\n\n  if [[ -f \"$cfg\" ]]; then\n    swiftlint lint --quiet --use-script-input-files --config \"$cfg\" || true\n  else\n    # Sin config: usa reglas por defecto\n    swiftlint lint --quiet --use-script-input-files || true\n  fi\n\n  # Limpia variables para no contaminar la siguiente invocación\n  unset SCRIPT_INPUT_FILE_COUNT\n  i=0\n  for _ in \"${files[@]}\"; do\n    unset \"SCRIPT_INPUT_FILE_$i\" || true\n    ((i++))\n  done\n}\n\necho \"SwiftLint: $((${#APP_FILES[@]} + ${#PKG_FILES[@]})) archivos .swift modificados\"\n\n# Lint app\nlint_with_list \"$APP_CONFIG\" \"${APP_FILES[@]}\"\n\n# Lint paquete (si existe)\nif [[ -d \"$PKG_DIR\" ]]; then\n  lint_with_list \"$PKG_CONFIG\" \"${PKG_FILES[@]}\"\nfi\n\n# Sugerencia: habilita caché para acelerar builds (crea .swiftlint.cache en el repo)\n# swiftlint lint --cache-path \"$GIT_ROOT/.swiftlint.cache\" ...\n\n";
